import React, { Component } from "react";
import { connect } from "react-redux";
import "./GetCollection.css";
import { TestFunction } from "./actions/allActions";

class GetCollection extends Component {
  componentDidMount() {
    this.props.TestFunction();
  }
  render() {
    const { testData } = this.props;
    return (
      <div class="bg-dark">
        <div class="jumbotron jumbotron-fluid bg-dark text-white">
          <div class="container">
            <h1 class="display-3">Just In Time Development</h1>
            <hr class="display-5" />
            <h4 class="text-right">App Development Made Easier</h4>
          </div>
        </div>
        <div class="container">
          <div class="row">
            <div class="col-md-6">
              <form method="post" action="#" id="#">
                <div class="form-group files">
                  <label>Upload Your File </label>
                  <input type="file" class="form-control" multiple="" />
                </div>
              </form>
            </div>
            <div class="col-md-6">
              <form method="post" action="#" id="#">
                <div class="form-group files color">
                  <label>Upload Your File </label>
                  <input type="file" class="form-control" multiple="" />
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  testData: state.dataFromReducer.TestDataInAllReducers,
});

export default connect(mapStateToProps, { TestFunction })(GetCollection);
